import React, { useState, useContext } from 'react';
import { AuthContext } from '../context/AuthContext';

const Register = () => {
    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('');
    const { register } = useContext(AuthContext);

    const handleSubmit = async (e) => {
        e.preventDefault();
        await register(username, password);
    };

    return (
        <div id="loginContainer">
            <div id="loginHeader">Register</div>
            <div id="formContainer">
                <form onSubmit={handleSubmit}>
                    <div className="inputGroup">
                        <label id="inputHeading" htmlFor="usernameInput">Email</label>
                        <input
                            id="usernameInput"
                            type="text"
                            placeholder="example@email.com"
                            value={username}
                            onChange={(e) => setUsername(e.target.value)}
                        />
                    </div>
                    <div className="inputGroup">
                        <label id="inputHeading" htmlFor="passwordInput">Password</label>
                        <input
                            id="passwordInput"
                            type="password"
                            placeholder="Password"
                            value={password}
                            onChange={(e) => setPassword(e.target.value)}
                        />
                    </div>
                    <div className="inputGroup">
                        <label id="inputHeading" htmlFor="passwordInput">Confirm password</label>
                        <input
                            id="passwordInput"
                            type="password"
                            placeholder="Confirm password"
                            value={password}
                            onChange={(e) => setPassword(e.target.value)}
                        />
                    </div>
                    <button type="submit" id="loginButton">Register</button>
                </form>
            </div>
            <div>
                <a id="registerLink" href="/login">Already have an account? Log in</a>
            </div>
        </div>
    );
};

export default Register;
